import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import axios from 'axios';
import Homepage from './Homepage';
import CategoryPage from './CategoryPage';
import LoginPage from './LoginPage';
import SignupPage from './SignupPage';
import AccountPage from './AccountPage';
import FavoritesPage from './FavoritesPage';
import Header from './Header';
import AttributePage from './AttributePage';
import ProductPage from './ProductPage';
import AdminHome from './AdminHome';
import AdminPage from './AdminPage';
import Layout from './Layout';

const App = () => {
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [categories, setCategories] = useState([]);
  const [users, setUsers] = useState([]);

  useEffect(() => {
    const fetchCategories = async () => {
      try {
        const response = await axios.get('http://localhost:5000/api/categories');
        setCategories(response.data.map((item) => item.category_name));
      } catch (error) {
        console.error('Error fetching categories:', error);
      }
    };
    fetchCategories();
  }, []);

  useEffect(() => {
    const fetchUsers = async () => {
      try {
        const response = await axios.get('http://localhost:5000/api/users');
        setUsers(response.data.map((item) => item.user));
      } catch (error) {
        console.error('Error fetching users:', error);
      }
    };
    fetchUsers();
  }, []);

  return (
    <Router>
      <Routes>
        <Route
          path="/"
          element={
            <>
              <Header isLoggedIn={isLoggedIn} setIsLoggedIn={setIsLoggedIn} />
              <Layout sidebarContent={<SidebarContent categories={categories} />}>
                <Homepage isLoggedIn={isLoggedIn} setIsLoggedIn={setIsLoggedIn} categories={categories} />
              </Layout>
            </>
          }
        />
        <Route
          path="/login"
          element={<LoginPage setIsLoggedIn={setIsLoggedIn} />}
        />
        <Route
          path="/signup"
          element={<SignupPage setIsLoggedIn={setIsLoggedIn} />}
        />
        <Route
          path="/account"
          element={
            <>
              <Header isLoggedIn={isLoggedIn} setIsLoggedIn={setIsLoggedIn} />
              <Layout sidebarContent={<SidebarContent categories={categories} />}>
                <AccountPage categories={categories} isLoggedIn={isLoggedIn} setIsLoggedIn={setIsLoggedIn} />
              </Layout>
            </>
          }
        />
        <Route
          path="/favorites"
          element={
            <>
              <Header isLoggedIn={isLoggedIn} setIsLoggedIn={setIsLoggedIn} />
              <Layout sidebarContent={<SidebarContent categories={categories} />}>
                <FavoritesPage categories={categories} isLoggedIn={isLoggedIn} setIsLoggedIn={setIsLoggedIn} />
              </Layout>
            </>
          }
        />
        <Route
          path="/admin"
          element={<AdminPage />}
        />
        <Route
          path="/admin/home"
          element={<AdminHome />}
        />
        <Route
          path="/category/:category_name"
          element={
            <>
              <Header isLoggedIn={isLoggedIn} setIsLoggedIn={setIsLoggedIn} />
              <Layout sidebarContent={<SidebarContent categories={categories} />}>
                <CategoryPage />
              </Layout>
            </>
          }
        />
        <Route
          path="/attribute/:attribute_id"
          element={
            <>
              <Header isLoggedIn={isLoggedIn} setIsLoggedIn={setIsLoggedIn} />
              <Layout sidebarContent={<SidebarContent categories={categories} />}>
                <AttributePage isLoggedIn={isLoggedIn} setIsLoggedIn={setIsLoggedIn} />
              </Layout>
            </>
          }
        />
        <Route
          path="/products/:productId"
          element={
            <>
              <Header isLoggedIn={isLoggedIn} setIsLoggedIn={setIsLoggedIn} />
              <Layout>
                <ProductPage isLoggedIn={isLoggedIn} setIsLoggedIn={setIsLoggedIn} />
              </Layout>
            </>
          }
        />
      </Routes>
    </Router>
  );
};

const SidebarContent = ({ categories }) => (
  <div>
    <h3>Kategoriler</h3>
    <ul>
      {categories.map((category, index) => (
        <li key={index}>{category}</li>
      ))}
    </ul>
  </div>
);

export default App;
